function TIC()



	if gamestate == "startup" then
	 gamestate = "menu"
	 --worldchange(5,1)
		--gamestate="worldmap"
		--gamestate = "play"
		
	elseif gamestate == "menu" then
	 pal(3,199,220,208)
		
		
		if cloud == false then
		 clouds(30,false,2,3)
			cloud = true
		end
		
		clouds(280+cam.x,true,2,3)

	 
		cls()
		rect(60,50,20,150,1)
		rect(100,30,20,150,1)
		rect(230,90,20,150,1)
		
		circ(60,200,120,7)
		circ(160,230,120,7)
		
		circ(0,160,80,6)
		circ(240,180,80,6)
		
		circ(80,160,50,5)
		circ(180,150,60,5)
		
		
		if #allparticles~=0 then
	  for i,particle in ipairs(allparticles) do
	   if particle.rad ==0 then
	    pix(particle.x-cam.x,particle.y-cam.y,particle.clr)
	   else
	    circ(particle.x-cam.x,particle.y-cam.y,particle.rad,particle.clr)
	   end
			end
		end
		
